import '../styles/App.css';
import '../styles/Intro.css';
import img1 from '../images/picture1.png';
import img2 from '../images/picture2.png';
function Intro() {
  return (
    <div className='app-body-comp'>
        <div className='intro-container'>
            <h1 className='intro-title'>Getting Started</h1>
            <h2 className='intro-title intro-title-2'>With 3 Easy Steps</h2>
        </div>
        <div className='steps-container'>
            <div className='step-box'>
                <p className='intro-title step-title'>1. Take a photo</p>
                <img className='step-img' src={img1} />
            </div>
            <div className='step-box'>
                <p className='intro-title step-title'>2. Upload Image</p>
                <img className='step-img' src={img1} />
            </div>
            <div className='step-box'>
                <p className='intro-title step-title'>3. Choose Language</p>
                <img className='step-img' src={img1} />
            </div>
        </div>
    </div>
  );
}

export default Intro;
